import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Helmet } from 'react-helmet';
import Header from '../components/Header/Header';
import Footer from '../components/Footer/Footer';
import DateDisplay from '../components/DateDisplay';
import '../styles/_notfoundpage.sass'; // Ensure you have the correct path to your SASS file
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHome } from '@fortawesome/free-solid-svg-icons';

const NotFoundPage: React.FC = () => {
    const navigate = useNavigate();


    return (
        <div className="container">
            <Helmet>
                <title>Page Not Found</title>
            </Helmet>
            <Header title="Page Not Found" />
            <DateDisplay />
            <div className="content notfound-content">
                <h2>Oops 404!</h2>
                <h1>Page Not Found</h1>
                <span className="redirect-link" onClick={() => navigate('/')}>
                    <p>Click here to return <FontAwesomeIcon icon={faHome} /></p>
                </span>
            </div>
            <Footer />
        </div>
    );
};

export default NotFoundPage;
